class Blockchain extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      provider: undefined,
      account: undefined,
      balance: undefined,
      paintProjectContract: undefined,
      totalSupply: 0,
      colors: [],
      isShowingNetworkError: false   
    };
  }

  // Make sure to manually call this in index.html
  async componentDidMount() {
    await this.loadWeb3();
    await this.loadBlockchainData();
    this.listenForChangesInNetworkAndWallet()
  }

  async loadWeb3() {
    const provider = new ethers.providers.Web3Provider(window.ethereum);
    // Because this whole thing is really hacky, set state incorrectly:
    this.state.provider = provider;
    console.log(`provider`, provider)
    console.log(`this.state.provider.getSigner()`, this.state.provider.getSigner());
  }

  async loadBlockchainData() {
    const networkData = thePaintProject.networks[window.ethereum.networkVersion];
    if (networkData) {
      this.closeNetworkError();
      const signer = this.state.provider.getSigner();
      console.log(`signer`, signer);
      await this.updateContractBasedOnWalletConnection(signer, networkData);
    } else {
      console.log('hol up, sleeping');
      await this.sleep(1000)
      this.showNetworkError();
    }
  }

  async updateColorList() {
    console.log('attempting to get total supply...');
    const totalSupply = await this.state.paintProjectContract.totalSupply().then(bigNum => bigNum.toNumber());
    this.state.totalSupply = totalSupply;
    console.log('this.state.totalSupply :>> ', this.state.totalSupply);

    this.state.colors = [];
    for (let i = 0; i < totalSupply; i++) {
      let c = await this.state.paintProjectContract.colors(i);
      this.state.colors.push(c);
    }
    console.log('this.state.colors :>> ', this.state.colors);
  }

  async connectWallet() {
    if (!isReadyForMinting) {
      show_error_message("You'll be able to connect a wallet when the project is launched. To be the first to know when we launch, join our Discord. The link is in the About page in the \"Help & About\" menu above.")
      return;
    }
    await this.state.provider.send("eth_requestAccounts", []);
    this.updateContractWithSignerInfo();
    await this.showWalletInfo();
    resetColorForm();
  }

  async listenForChangesInNetworkAndWallet() {
    // wait for page to load before listening
    await this.sleep(1000);
    while(true) {
      const networkData = thePaintProject.networks[window.ethereum.networkVersion];
      if (networkData) {
        this.closeNetworkError();
        const signer = this.state.provider.getSigner();
        try {
          const account = await signer.getAddress();
          if(this.state.account != account) {
            console.log('WALLET HAS CHANGED');
            await this.updateContractBasedOnWalletConnection(signer, networkData);
          }
        } catch (error) {
          // no wallet connected
          await this.updateContractBasedOnWalletConnection(signer, networkData);
        }
      } else {
        this.showNetworkError();
      }
      await this.sleep(1000);
    }
    // if not on mainnet, show error
  }
  
  async sleep(ms) {
    return new Promise(resolve => setTimeout(resolve, ms));
  }

  closeNetworkError() {
    $("#network").remove();
  }

  showNetworkError() {
    if (!this.state.isShowingNetworkError) {
      show_error_message('We have detected you switched networks. Please switch to the Ethereum Mainnet.', "network")
      this.state.isShowingNetworkError = true;
    }
  }

  async updateContractBasedOnWalletConnection(signer, networkData) {
    let walletConnected;
    try {
      await signer.getAddress();
      walletConnected = true;
    } catch (e) {
      walletConnected = false;
    }
    console.log(`walletConnected`, walletConnected);
    if (walletConnected) {
      this.updateContractWithSignerInfo();
      await this.showWalletInfo();
    } else {
      // allow page load
      this.sleep(1000);
      this.updateContractWithNoWallet(networkData);
    }
    resetColorForm();
  }

  updateContractWithSignerInfo() {
    const networkData = thePaintProject.networks[window.ethereum.networkVersion];
    // console.log('updateContractWithSignerInfo()');
    const paintProjectContract = new ethers.Contract(
      networkData.address,
      thePaintProject.abi,
      this.state.provider.getSigner()
    );
    this.state.paintProjectContract = paintProjectContract;
    // console.log('this.state.paintProjectContract :>> ', this.state.paintProjectContract);
  }

  updateContractWithNoWallet(networkData) {
    // console.log('updateContractWithNoWallet');
    const paintProjectContract = new ethers.Contract(
      networkData.address,
      thePaintProject.abi,
      this.state.provider
    );
    this.state.paintProjectContract = paintProjectContract;
    this.showWalletNotConnectedText();
    // console.log('this.state.paintProjectContract :>> ', this.state.paintProjectContract);
  }

  async showWalletInfo() {
    const signer = this.state.provider.getSigner();
    const account = await signer.getAddress();
    this.state.account = account;
    accountNumberLabel.innerHTML = "| Connected with " + account;
  }
  
  showWalletNotConnectedText() {
    accountNumberLabel.innerHTML = "| Wallet not connected. Click the Wallet button on the left to connect.";
  }

  async getColorsForCurrentAccount() {
    console.log(`blockchain.state.account`, blockchain.state.account);
    const res = await blockchain.state.paintProjectContract.getColorsOfOwner(blockchain.state.account)
    console.log(`res`, res);
    return res;
  }

  async mint(color) {
    color = color.toUpperCase();
    console.log('blockchain minting color:', color);
    const result = await this.state.paintProjectContract.mint(color)
    console.log('result :>> ', result);
    return await result.wait();
  }

}

